import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from "./components/Header/Header";
import Technoligies from "./Technologies";
import Footer from "./Footer";
import anonymous from "./media/create_account_2_anonymous.png"
import back_img from "./media/back_img.jpg"
import raccoon from "./media/raccoon.jpg"
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import Dialogs from "./components/Dialogs/Dialogs";
import {Route, BrowserRouter} from "react-router-dom";
import News from "./components/News/News";
import Settings from "./components/Settings/Settings";
import Music from "./components/Music/Music";

function App() {
  return (
    <BrowserRouter>
        <div className="app-wrapper">
            <Header/>
            <Navbar/>
            <div className="app-wrapper-content">
                <Route exact path="/dialogs" component={Dialogs} />
                <Route exact path="/profile" component={Profile}/>
                <Route exact path="/feed" component={News}/>
                <Route exact path="/settings" component={Settings}/>
                <Route exact path="/music" component={Music}/>
            </div>
        </div>
    </BrowserRouter>
  );
}





export default App;
